import './App.css';
import Logo from './img/logo.svg'

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={Logo} className="logo" alt="logo" />
          <nav>
              <ul>
                  <li>Главная</li>
                  <li>Каталог</li>
                  <li>О продукции</li>
                  <li>О нас</li>
                  <li></li>
              </ul>
          </nav>
      </header>
    </div>
  );
}

export default App;
